const VisitorList = ({index_message_list}) => {
    return (
        <div className="visitorList borderNone">
            <div className="visitorTitle">
                留言列表 
            </div>
            <ul>
                {
                    index_message_list.map(mess => {
                        return (
                            <li key={mess.id} className="visitorInfo">
                                <span>{mess.ip}</span>
                                <span>{mess.content}</span>
                            </li>
                        )
                    })
                }
            </ul>
            <style jsx>
            {`
                .homeRight{
                    padding: 20px;
                }
                .visitorList{
                    padding-bottom:20px;
                    border-bottom:1px solid #cccccc;
                    margin-bottom: 20px;
                }
                .homeRight .visitorList li{
                    margin-bottom: 5px;
                }
                .visitorTitle{
                    font-size: 12px;
                    color: #333333;
                    margin-bottom: 10px;
                }
                .visitorInfo{
                    margin-top:5px;
                    margin-bottom:5px;
                }
                .visitorInfo span{
                    font-size: 12px;
                    color: #666666;
                    margin-right: 10px;
                }
                .borderNone{
                    border:none;
                }
            `}
            </style>
        </div>
    )
}

export default VisitorList;
